import './MessagePost.css'
import {Link} from "react-router-dom";

const MessagePost =({user})=> {
    return (
        <>
            <div className='messageContent'><Link to={`/profile/${user.id}`} className='LinkMessage'>{user.user_name}</Link></div>
        </>
    )
}

export default MessagePost;
